import React, { Component, Fragment } from 'react';
import Nav from './Nav';
import Header from './Header';

class Home extends Component {

    constructor(props){
        super(props);

        this.state = {
            search_input: '',
            list: {p1:'one',p2:'tow'}
        }
    }

    render() {
        return (
            <Fragment>
                <Nav/>
                <Header/>
            </Fragment>
        )
    }

}

export default Home;
